import React from "react";

const Footer = () => {
  return (
    <div className="footer">
      <ul>
        <li className="btn btnFooter">
          <a href="#home">Home</a>
        </li>
        <li className="btn btnFooter">
          <a href="#aboutUs">About us</a>
        </li>
        <li className="btn btnFooter">
          <a href="#contact">Contact us</a>
        </li>
      </ul>
    </div>
  );
};

export default Footer;
